import React, { Component } from 'react'

export default class Notes extends Component {
    render() {
        var allNotes = JSON.parse(localStorage.getItem("allNotes"));
        return (
           
            allNotes.map(note => {
                return(
                     <div>
                         <h1>{note.title}</h1>
                         <h3>Last Modified{" "}
              {new Date(note.last).toLocaleDateString("en-GB", {
                hour: "2-digit",
                minute: "2-digit",
              })}</h3>
                     </div>              
                );
            })
        )
    }
}
